import React from 'react';
import { Link } from 'react-router-dom';

function MovieIndex({ movies }) {
    return (
        <div>
            <h1>All Movies</h1>
            <ul>
                {movies.map((movie) => (
                    <li key={movie.id}>
                        <Link to={`/movies/${movie.id}`}>{movie.title}</Link>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default MovieIndex;
